import React from 'react'

import {useParams} from 'react-router-dom'


const PageRender = () => {
    const {page, id} = useParams
    let pageName = "";
    if(id){
        pageName = `${page}/[id]`
    } else {
        pageName = `${page}`
    }
    console.log(pageName)
    return (
        <div>

        </div>
    )
}

export default PageRender
